import React from 'react';
import { Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';

/* ------- σελίδες ------- */
import Home from './pages/Home';
import Profile from './pages/Profile';
import MyBookings from './pages/MyBookings';
import NotFound from './pages/NotFound';
import Articles from './pages/Articles';
import Sitters from './pages/Sitters';
import Booking from './pages/Booking';
import Contact from './pages/Contact';
import Areas from './pages/Areas';
import AreaSitters from './pages/AreaSitters';

/* ------- components ------- */
import Login from './components/auth/Login.jsx';
import Register from './components/auth/Register.jsx';
import ForgotPassword from './components/auth/ForgotPassword.jsx';
import Header from './components/common/Header';
import Footer from './components/common/Footer';

function App() {
  return (
    <AuthProvider>
      <div className="fixed inset-0 z-0 pointer-events-none overflow-hidden opacity-20 saturate-50">
      {/* Layer 1 – πολύ πίσω, μικρά, αχνά */}
      <span className="shape blur-sm" style={{ top: '8%', left: '5%', scale: '0.6', animationDelay: '0s', rotate: '12deg' }}>
        <svg width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="#bae6fd" strokeWidth="1.5"><path d="M12 2a5 5 0 0 1 5 5c0 1.5-.5 3-2 4l-3 3-3-3c-1.5-1-2-2.5-2-4a5 5 0 0 1 5-5z"/><path d="M12 12c-3.5 0-6.5 1.5-8 4l8 8 8-8c-1.5-2.5-4.5-4-8-4z"/></svg>
      </span>
      <span className="shape blur-sm" style={{ top: '85%', left: '90%', scale: '0.5', animationDelay: '7s', rotate: '-8deg' }}>
        <svg width="18" height="18" viewBox="0 0 24 24" fill="none" stroke="#ddd6fe" strokeWidth="1.5"><path d="M15 12c0 2.2-1.8 4-4 4s-4-1.8-4-4 1.8-4 4-4 4 1.8 4 4z"/><path d="M12 2v4m0 12v4m-6-10h4m8 0h4"/></svg>
      </span>

      {/* Layer 2 – μεσαίο μέγεθος, κανονική ευκρίνεια */}
      <span className="shape" style={{ top: '25%', left: '15%', scale: '1', animationDelay: '3s', rotate: '45deg' }}>
        <svg width="28" height="28" viewBox="0 0 24 24" fill="none" stroke="#7dd3fc" strokeWidth="2"><path d="M12 2a5 5 0 0 1 5 5c0 1.5-.5 3-2 4l-3 3-3-3c-1.5-1-2-2.5-2-4a5 5 0 0 1 5-5z"/><path d="M12 12c-3.5 0-6.5 1.5-8 4l8 8 8-8c-1.5-2.5-4.5-4-8-4z"/></svg>
      </span>
      <span className="shape" style={{ top: '70%', left: '75%', scale: '0.9', animationDelay: '8s', rotate: '-20deg' }}>
        <svg width="26" height="26" viewBox="0 0 24 24" fill="none" stroke="#c4b5fd" strokeWidth="2"><path d="M15 12c0 2.2-1.8 4-4 4s-4-1.8-4-4 1.8-4 4-4 4 1.8 4 4z"/><path d="M12 2v4m0 12v4m-6-10h4m8 0h4"/></svg>
      </span>

      {/* Layer 3 – μπροστά, μεγαλύτερα, πιο έντονα */}
      <span className="shape" style={{ top: '40%', left: '85%', scale: '1.3', animationDelay: '11s', rotate: '90deg' }}>
        <svg width="34" height="34" viewBox="0 0 24 24" fill="none" stroke="#fbbf24" strokeWidth="2"><circle cx="12" cy="12" r="10"/><path d="M12 2a15.3 15.3 0 0 1 4 10 15.3 15.3 0 0 1-4 10 15.3 15.3 0 0 1-4-10 15.3 15.3 0 0 1 4-10z"/></svg>
      </span>
      <span className="shape" style={{ top: '10%', left: '50%', scale: '1.2', animationDelay: '16s', rotate: '-35deg' }}>
        <svg width="32" height="32" viewBox="0 0 24 24" fill="none" stroke="#fca5a5" strokeWidth="2"><path d="M4 13.5c0-2 1.5-4.5 3-4.5s3 2.5 3 4.5v1c0 2-1.5 4.5-3 4.5s-3-2.5-3-4.5v-1z"/><path d="M20 13.5c0-2-1.5-4.5-3-4.5s-3 2.5-3 4.5v1c0 2 1.5 4.5 3 4.5s3-2.5 3-4.5v-1z"/><path d="M12 3c-2 0-4 1-4 3v1c0 2 2 3 4 3s4-1 4-3V6c0-2-2-3-4-3z"/><path d="M12 14v6"/></svg>
      </span>
    </div>

      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/articles" element={<Articles />} />
        <Route path="/sitters" element={<Sitters />} />
        <Route path="/areas" element={<Areas />} />
        <Route path="/areas/:slug" element={<AreaSitters />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/forgot-password" element={<ForgotPassword />} />
        <Route path="/profile" element={<Profile />} />
        <Route path="/my-bookings" element={<MyBookings />} />
        <Route path="/booking" element={<Booking />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="*" element={<NotFound />} />
      </Routes>
      <Footer />
    </AuthProvider>
  );
}

export default App;
